import './assets/styles/home.css';
import Router from './Router';
import { ReviewContext } from './ReviewContext';


function App() {
    return(
        <div>
            <ReviewContext.Provider>
            <Router />
            </ReviewContext.Provider>
        </div>
    )
}

export default App;
